import React from 'react'
import { Grid, Container, Box } from '@material-ui/core'
import { makeStyles } from '@material-ui/core/styles';
import img1 from "../../images/bestSeller/b1.jpg";
import img2 from "../../images/bestSeller/b2.jpg";
import img3 from "../../images/bestSeller/b3.jpg";

import { Link } from 'react-router-dom';
import './BestSellerSection.css';

const categories =[
    {
      name: 'clothes',
      url: '/shop/clothes',
      imgUrl: img1
    },
    {
      name: 'shoes',
      url: '/shop/shoes',
      imgUrl: img2
    },
    {
      name: 'electronics',
      url: '/shop/electronics',
      imgUrl: img3
    }
];

const BestSeller = () => {
  return (
    <Grid id="sh" container className="categorySectionContainer">
      {categories.map((index) => (
        <div className="categoryItem">
          <img src={index.imgUrl}/>
          <div className="overlay" />
      </div> 
    ))}
    </Grid>
  )
}

export default BestSeller;
